import React from "react";
import { YOUTUBEURL, PLAYLISTSITEMS, apiKey } from "./apis";
import { useState } from "react";
import Playlist from '../components/movie/Playlist';
import ids from "../channelId/ids";

const PlaylistItems = async ({createrId}) => {
  const [plistItems, setPlistItems] = useState([]);
  const id=Playlist(movieId)[0];
  const title=Playlist(movieId)[1];
  const json = await (
    await fetch(
      `${YOUTUBEURL}${PLAYLISTSITEMS}?key=${apiKey}&playlistId=${
        id
      }&part=snippet`
    )
  ).json();
  setPlistItems(json);
  const videoId=plistItems.itmes?.snippet.resourceId.videoId;
  return videoId;
};

export default PlaylistItems;
